import Home from "../home";
import { BrowserRouter, Routes, Route} from "reac"

const Way = () => {
    return(
        <>
            <BrowserRouter>
            <Routes>
                <Route element={ < Home />} to="/" />
            </Routes>
            </BrowserRouter>
        </>
    )
}
export default Way;
